/**
 * 个人中心路由
 */
const set = () => import('@/components/user/set.vue')
const Modify = () => import('@/components/user/Modify')
const note = () => import('@/components/user/useNote')
const browseMode = () => import('@/components/user/browseMode')
const projectChange = () => import("@/components/user/projectChange")
const sponsorSee = () => import("@/components/user/sponsorSee")
const addFlow = () => import("@/components/user/addFlow")
const projectChangeDetails = () => import("@/components/user/projectChangeDetails")
const submitSuccess = () => import("@/components/user/submitSuccess")
const abarbeitung =()=> import("@/components/user/abarbeitung")
const addressList= ()=> import("@/components/user/addressList")
const purchaseDetails= ()=> import("@/components/user/purchaseDetails")
export default [
    {
        path: '/set',
        name: '设置',
        component: set
    },
    {
        path: '/Modify',
        name: '修改个人信息',
        component: Modify
    },
    {
        path: '/note',
        name: '使用说明',
        component: note
    },
    {
        path: '/browseM',
        name: '浏览模型',
        component: browseMode
    },
    {
        path: '/projectChange',
        name: '工程变更',
        component: projectChange
    },
    {
        path: '/projectChangeDetails',
        name: '工程变更详情',
        component: projectChangeDetails
    },
    {
        path: '/purchaseDetails',
        name: '采购详情',
        component: purchaseDetails
    },
    {
        path: '/sponsorSee',
        name: '发起沟通',
        component: sponsorSee,
    },
    {
        path: '/submitSuccess',
        name: "提交成功",
        component: submitSuccess,
    },
    {
        path: '/addFlow',
        name: '编辑工作流程',
        component: addFlow
    },
    {
        path:"/abarbeitung",
        name:"整改认证",
        component:abarbeitung
    },
    {
        path:"/addressList",
        name:"施工单位通讯录",
        component:addressList
    }
]
